import React from 'react';

const HeaderAdmin = () => {
    return (
        <div
            className="w-[1440px] h-16 px-[15px] bg-white rounded-[14px] justify-start items-center gap-[276px] inline-flex mx-[200px]">
            <div className="h-10 justify-start items-center gap-2.5 flex">
                <div className="w-10 h-10 relative">
                    <div className="w-10 h-10 left-0 top-0 absolute bg-stone-300 rounded-full"/>
                    <img className="w-[60px] h-10 left-[-10px] top-0 absolute" src="https://via.placeholder.com/60x40"/>
                </div>
                <div
                    className="w-[150px] h-[26px] text-black text-xl font-medium font-['Roboto'] leading-[30px] tracking-tight">Димон
                    Д.
                </div>
                <div className="w-6 h-6 px-[7px] justify-center items-center flex"/>
            </div>
        </div>
    );
};

export default HeaderAdmin;
